import React from 'react';
import logo from './logo.svg';
import './App.css';
import Background from './../components/background/Background';

function App() {
  return (
    <div className="App">
      <Background 
        color="red"
        language="pt"
        title="title"
        sub="subtitle"
        button="CLICK ME"
      />
    </div>
  );
}

export default App;
